import React from "react";
import "./Home.css";
import Poster from "./Poster";
import poster_one from "./img/poster__home__page/poster_one.jpg";
import poster_two from "./img/poster__home__page/poster_two.jpg";
import poster_three from "./img/poster__home__page/poster_three.jpg";
import poster_four from "./img/poster__home__page/poster_four.jpg";
import Product from "./Product";
import product_one from "./img/product_img/product_one.jpg"
import product_two from "./img/product_img/product_two.jpg"
import product_three from "./img/product_img/product_three.jpg"

function Home() {
  const banners = [poster_one, poster_two, poster_three, poster_four];
  return (
    <div className="home">
      <div className="container">
        
          <Poster bannersArray={banners} />
       <div className="row">

       
           <div class="col-sm-4">
          <Product
            id="4427"
            title="Comfy styles for her"
            price={99}
            image={product_one}
            rating={5}
          />
          <Product
            id="4754"
            title="Shop Laptops & Tablets"
            price={245}
            image={product_two}
            rating={2}
          />
          <Product
            id="4754"
            title="Shop Laptops & Tablets"
            price={245}
            image={product_three}
            rating={2}
          />
          <Product
            id="4754"
            title="Shop Laptops & Tablets"
            price={245}
            image={product_one}
            rating={2}
          />
       </div>  
        </div>
        <div className="home__row">
        <Product
            id="4637"
            title="Explore home bedding"
            price={245}
            image="https://images-na.ssl-images-amazon.com/images/G/01/AmazonExports/Fuji/2020/May/Dashboard/Fuji_Dash_HomeBedding_Single_Cat_1x._SY304_CB418596953_.jpg"
            rating={2}
          />
          <Product
            id="5878"
            title="Gaming merchandise"
            price={245}
            image="https://images-na.ssl-images-amazon.com/images/G/01/AmazonExports/Fuji/2020/May/Dashboard/Fuji_Dash_Laptops_379x304_1X_en_US._SY304_CB418608471_.jpg"
            rating={2}
          />
          <Product
            id="8574"
            title="Shop Laptops & Tablets"
            price={245}
            image="https://images-na.ssl-images-amazon.com/images/G/01/AmazonExports/Fuji/2020/May/Dashboard/Fuji_Dash_TV_2X._SY304_CB432517900_.jpg"
            rating={2}
          />
        </div>
        <div className="home__row">
        <Product
            id="5452"
            title="Oculus"
            price={245}
            image="https://images-na.ssl-images-amazon.com/images/G/01/AmazonExports/Fuji/2021/June/Fuji_Dash_Oculus_1x._SY304_CB667158353_.jpg"
            rating={2}
          />
          <Product
            id="5452"
            title="Oculus"
            price={245}
            image="https://images-na.ssl-images-amazon.com/images/G/01/AmazonExports/Fuji/2021/June/Fuji_Dash_Oculus_1x._SY304_CB667158353_.jpg"
            rating={2}
          />
          <Product
            id="5452"
            title="Oculus"
            price={245}
            image="https://images-na.ssl-images-amazon.com/images/G/01/AmazonExports/Fuji/2021/June/Fuji_Dash_Oculus_1x._SY304_CB667158353_.jpg"
            rating={2}
          />
          <Product
            id="5452"
            title="Oculus"
            price={245}
            image="https://images-na.ssl-images-amazon.com/images/G/01/AmazonExports/Fuji/2021/June/Fuji_Dash_Oculus_1x._SY304_CB667158353_.jpg"
            rating={2}
          />
        </div>
      </div>
    </div>
  );
}

export default Home;
